import styled from 'styled-components';

const PicDiv = styled.div`
    display: grid;
    grid-template-columns: 10px auto 20px;
`;

const Logo = styled.div`
    grid-column: 2 / 3;
    position: absolute;
    z-index: 2;
`;

// const Image = styled.div`
